tables.table_schema:
CREATE TABLE StudentDemographics (
    student_id SERIAL PRIMARY KEY,
    first_name VARCHAR(50),
    last_name VARCHAR(50),
    age INTEGER,
    gender VARCHAR(10)
);

CREATE TABLE GraduationRates (
    graduation_id SERIAL PRIMARY KEY,
    student_id INTEGER,
    graduation_date DATE,
    graduation_status VARCHAR(20)
);

CREATE TABLE graduation_rates (
    student_id INT PRIMARY KEY,
    graduation_year INT,
    graduation_status TEXT,
    gpa FLOAT
);

CREATE TABLE program_outcomes (
    student_id INT PRIMARY KEY,
    program_name TEXT,
    employment_status TEXT,
    salary FLOAT
);
